import React from 'react';
import { Box, Center, GluestackUIProvider, ImageBackground, Text, VStack, View } from '@gluestack-ui/themed';
import { config } from '@gluestack-ui/config';
import Loader from '../components/Loader';

export default function ViewNotePage() {
    return (
        <GluestackUIProvider config={config}>
            <ImageBackground
                source={require('../img/bg.png')}
                style={{ flex: 1, justifyContent: "center" }}>
                <View flex={1}>
                    <View>
                        <Text m='$4' size='4xl' fontWeight='$bold'>This is Header</Text>
                    </View>
                    <Center>
                        <Box justifyContent='center' flex={1}>
                            <VStack p='$4' >
                                <Box w='$20' h='$20' bg='$blue300' />
                                <Box w='$20' h='$20' bg='$blue400' />
                                <Box w='$20' h='$20' bg='$blue500' />
                            </VStack>
                        </Box>
                    </Center>
                    <View>

                        <Box
                            h={360}
                            w={320}
                            bg="$backgroundLight50"
                            $dark-bg="$backgroundDark900"
                            borderRadius="$md"
                        >
                            <Fab size="md" placement="bottom right" isHovered={false} isDisabled={false} isPressed={false} >
                                <FabIcon as={AddIcon} mr="$1" />
                                <FabLabel>Quick start</FabLabel>
                            </Fab>
                        </Box>

                    </View>
                </View>
            </ImageBackground>
            {/* <Loader /> */}
        </GluestackUIProvider>
    );
}
